    <div>
        <header><HomeNavBar/></header>
        <div style={{ height: '100%', position: 'absolute', left: '0px', width: '100%', overflow: 'hidden'}}>
        <HomeCarrousel></HomeCarrousel>
        </div>        
    </div>
    );
    
    
    export default HomePage;
